import React, { useEffect, useState } from "react";
import Navbar from "../../components/Navbar";
import AdminPanel from "../../components/AdminPanel";
import Footer from "../../components/Footer";
import axios from "axios";
import { toast } from "react-toastify";
import { Link, useNavigate } from "react-router-dom";

const AdminServiceTimes = () => {
  const [averageDurations, setAverageDurations] = useState([]);
  const [monthlyDeliveries, setMonthlyDeliveries] = useState(0);
  const [ordersInProgress, setOrdersInProgress] = useState([]);
  const [notstarted, setNotStarted] = useState([]);
  const [ordersAwaiting, setOrdersAwaiting] = useState([]);
  const [ordersCompleted, setOrdersCompleted] = useState([]);
  const [ordersDelivered, setOrdersDelivered] = useState([]);
  const [users, setUsers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [display, setDisplay] = useState(false);
  const [selectedIndex, setSelectedIndex] = useState("Employee Report");
  const apiUrl = window.location.origin.includes("localhost")
    ? "http://localhost:5000/admin/service-times"
    : "https://khamco-shop-backend.onrender.com/admin/service-times";
  const authKey = localStorage.getItem("jwt");
  const navigate = useNavigate();

  useEffect(() => {
    document.title = "Admin Services Data = Khamco Shop";
    const fetchData = async () => {
      await axios
        .get(apiUrl, {
          headers: { Authorization: `Bearer ${authKey}` },
        })
        .then((response) => {
          setAverageDurations(response.data.averageDurations);
          setMonthlyDeliveries(response.data.monthly_deliveries);
          setOrdersInProgress(response.data.orders_inprogress);
          setNotStarted(response.data.orders_notstarted);
      orders_require_alteration: orders_require_alteration,
          setOrdersDelivered(response.data.orders_delivered);
          setUsers(response.data.users);
          setIsLoading(false);
          setDisplay(true);
        })
        .catch((error) => {
          setIsLoading(true);
          setDisplay(false);
          if (error.response.status === 403) {
            toast.warn("You are not authorized to access that page");
            navigate("/");
          } else {
            toast.error(error.response?.data?.message || error.message);
          }
          return;
        });
    };

    fetchData();
  }, [apiUrl, authKey, navigate]);

  return (
    <>
      <Navbar />
      <main className="p-[1rem] md:p-[4rem]">
        <AdminPanel />
        <section className="admin-dashboard">
          <div className="flex justify-between gap-8 items-center mx-auto my-8 w-full flex-wrap">
            <Link
              to="/orders"
              target="_blank"
              className="text-[blue] no-underline hover:underline cursor-pointer"
            >
              Orders <i className="fas fa-external-link"></i>
            </Link>
          </div>
          {isLoading && (
            <>
              <div className="grid md:grid-cols-2 gap-[4rem] justify-center items-center w-[70vw] m-auto">
                <div className="text-center p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem] bg-[#ccc] shadow-none animate-pulse"></div>
                <div className="text-center p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem] bg-[#ccc] shadow-none animate-pulse"></div>
                <div className="text-center p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem] bg-[#ccc] shadow-none animate-pulse"></div>
              </div>
              <table className="text-center w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                <thead className="text-khamco-primary font-bold">
                  <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                    <td className="text-center p-2">Loading...</td>
                  </tr>
                </thead>
                <tbody>
                  <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative bg-[#aaa] animate-pulse text-[#aaa] h-12">
                    <td className="text-center p-2">k</td>
                  </tr>
                  <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative bg-[#aaa] animate-pulse text-[#aaa] h-12">
                    <td className="text-center p-2">k</td>
                  </tr>
                  <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative bg-[#aaa] animate-pulse text-[#aaa] h-12">
                    <td className="text-center p-2">k</td>
                  </tr>
                </tbody>
              </table>
            </>
          )}
          {display && (
            <>
              <div className="grid md:grid-cols-2 gap-[4rem] justify-center items-center w-[70vw] m-auto">
                <div className="text-center shadow-lg shadow-[gray] p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem]">
                  <p>Monthly Deliveries</p>
                  <h2 className="text-khamco-secondary text-2xl font-bold">
                    {new Date(
                      `${
                        new Date().getMonth() + 1
                      }/01/${new Date().getFullYear()}`
                    ).toLocaleDateString("en-US", {
                      month: "long",
                      year: "numeric",
                    })}
                  </h2>
                  <h2 className="text-green-500 text-[2.5rem] no-underline">
                    {monthlyDeliveries}
                  </h2>
                </div>
                {ordersInProgress && (
                  <div className="text-center shadow-lg shadow-[gray] p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem]">
                    <h2 className="text-khamco-secondary text-2xl font-bold">
                      Orders In Progress
                    </h2>
                    <h2 className="text-[tomato] text-[2.5rem] no-underline">
                      {ordersInProgress.length}
                    </h2>
                  </div>
                )}
                {ordersCompleted && (
                  <div className="text-center shadow-lg shadow-[gray] p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem]">
                    <h2 className="text-khamco-secondary text-2xl font-bold">
                      Orders Completed
                    </h2>
                    <h2 className="text-[gold] text-[2.5rem] no-underline">
                      {ordersCompleted.length}
                    </h2>
                  </div>
                )}
                {ordersAwaiting && (
                  <div className="text-center shadow-lg shadow-[gray] p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem]">
                    <h2 className="text-khamco-secondary text-2xl font-bold">
                      Orders Awaiting Delivery
                    </h2>
                    <h2 className="text-orange-500 text-[2.5rem] no-underline">
                      {ordersAwaiting.length}
                    </h2>
                  </div>
                )}
                {ordersDelivered && (
                  <div className="text-center shadow-lg shadow-[gray] p-8 rounded-2xl flex flex-col gap-4 min-h-[10rem]">
                    <h2 className="text-khamco-secondary text-2xl font-bold">
                      Orders Delivered
                    </h2>
                    <h2 className="text-[lightgreen] text-[2.5rem] no-underline">
                      {ordersDelivered.length}
                    </h2>
                  </div>
                )}
              </div>
              <div className="w-full md:w-2/5 flex justify-between mb-8 mt-[4rem]">
                <select
                  className="text-[1.2rem] p-[0.5rem] w-[80%] m-0 border-t-0 outline-none border-b-2 border-b-[#444] transition-all duration-200 ease-in-out cursor-pointer focus:pb-[1rem] focus:border-b-khamco-primary"
                  onChange={(e) => setSelectedIndex(e.target.value)}
                >
                  <option disabled>-- Select a Report --</option>
                  <option>Employee Report</option>
                  <option>Orders In Progress</option>
                  <option>Completed Orders</option>
                  <option>Orders Awaiting Delivery</option>
                  <option>Orders Delivered</option>
                </select>
              </div>
              {selectedIndex === "Employee Report" && (
                <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                  <caption className="text-khamco-primary font-bold mb-4">
                    Employee Report
                  </caption>
                  <thead className="text-khamco-primary font-bold">
                    <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                      <td className="text-center p-2 bg-[#ddd]">Name</td>
                      <td className="text-center p-2 bg-[#ddd]">Orders Cut</td>
                      <td className="text-center p-2 bg-[#ddd]">
                        Orders Measured
                      </td>
                      <td className="text-center p-2 bg-[#ddd]">Orders Sewn</td>
                    </tr>
                  </thead>
                  <tbody>
                    {users &&
                      users.map((user, index) => (
                        <tr
                          className="border-b-2 border-r-2 border-l-2 border-[blue] relative"
                          key={index}
                        >
                          <td className="text-center p-2">
                            {user.name} {user.surname}
                          </td>
                          <td className="text-center p-2">{user.cutting}</td>
                          <td className="text-center p-2">
                            {user.measurements}
                          </td>
                          <td className="text-center p-2">{user.sewing}</td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              )}
              {selectedIndex === "Orders In Progress" && (
                <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                  <caption className="text-khamco-primary font-bold mb-4">
                    Service Report for Orders In Progress (Averages)
                  </caption>
                  <thead className="text-khamco-primary font-bold">
                    <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                      <td className="text-center p-2 bg-[#ddd]">Month</td>
                      <td className="text-center p-2 bg-[#ddd]">Seconds</td>
                      <td className="text-center p-2 bg-[#ddd]">Minutes</td>
                      <td className="text-center p-2 bg-[#ddd]">Hours</td>
                      <td className="text-center p-2 bg-[#ddd]">Days</td>
                      <td className="text-center p-2 bg-[#ddd]">Weeks</td>
                      <td className="text-center p-2 bg-[#ddd]">Months</td>
                      <td className="text-center p-2 bg-[#ddd]">Years</td>
                    </tr>
                  </thead>
                  <tbody>
                    {averageDurations &&
                      averageDurations.map((duration, index) => (
                        <tr
                          className="border-b-2 border-r-2 border-l-2 border-[blue] relative"
                          key={index}
                        >
                          <td className="text-center p-2">
                            {new Date(
                              `${duration._id}/01/${new Date().getFullYear()}`
                            ).toLocaleDateString("en-US", {
                              month: "long",
                              year: "numeric",
                            })}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_seconds.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_minutes.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_hours.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_days.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_weeks.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_months.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.in_progress_years.toFixed(2)}
                          </td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              )}
              {selectedIndex === "Completed Orders" && (
                <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                  <caption className="text-khamco-primary font-bold mb-4">
                    Service Report for Orders Completed (Averages)
                  </caption>
                  <thead className="text-khamco-primary font-bold">
                    <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                      <td className="text-center p-2 bg-[#ddd]">Month</td>
                      <td className="text-center p-2 bg-[#ddd]">Seconds</td>
                      <td className="text-center p-2 bg-[#ddd]">Minutes</td>
                      <td className="text-center p-2 bg-[#ddd]">Hours</td>
                      <td className="text-center p-2 bg-[#ddd]">Days</td>
                      <td className="text-center p-2 bg-[#ddd]">Weeks</td>
                      <td className="text-center p-2 bg-[#ddd]">Months</td>
                      <td className="text-center p-2 bg-[#ddd]">Years</td>
                    </tr>
                  </thead>
                  <tbody>
                    {averageDurations &&
                      averageDurations.map((duration, index) => (
                        <tr
                          className="border-b-2 border-r-2 border-l-2 border-[blue] relative"
                          key={index}
                        >
                          <td className="text-center p-2">
                            {new Date(
                              `${duration._id}/01/${new Date().getFullYear()}`
                            ).toLocaleDateString("en-US", {
                              month: "long",
                              year: "numeric",
                            })}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_seconds.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_minutes.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_hours.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_days.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_weeks.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_months.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.completed_years.toFixed(2)}
                          </td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              )}
              {selectedIndex === "Orders Awaiting Delivery" && (
                <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                  <caption className="text-khamco-primary font-bold mb-4">
                    Service Report for Orders Awaiting Delivery (Averages)
                  </caption>
                  <thead className="text-khamco-primary font-bold">
                    <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                      <td className="text-center p-2 bg-[#ddd]">Month</td>
                      <td className="text-center p-2 bg-[#ddd]">Seconds</td>
                      <td className="text-center p-2 bg-[#ddd]">Minutes</td>
                      <td className="text-center p-2 bg-[#ddd]">Hours</td>
                      <td className="text-center p-2 bg-[#ddd]">Days</td>
                      <td className="text-center p-2 bg-[#ddd]">Weeks</td>
                      <td className="text-center p-2 bg-[#ddd]">Months</td>
                      <td className="text-center p-2 bg-[#ddd]">Years</td>
                    </tr>
                  </thead>
                  <tbody>
                    {averageDurations &&
                      averageDurations.map((duration, index) => (
                        <tr
                          className="border-b-2 border-r-2 border-l-2 border-[blue] relative"
                          key={index}
                        >
                          <td className="text-center p-2">
                            {new Date(
                              `${duration._id}/01/${new Date().getFullYear()}`
                            ).toLocaleDateString("en-US", {
                              month: "long",
                              year: "numeric",
                            })}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_seconds.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_minutes.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_hours.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_days.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_weeks.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_months.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.awaiting_years.toFixed(2)}
                          </td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              )}
              {selectedIndex === "Orders Delivered" && (
                <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
                  <caption className="text-khamco-primary font-bold mb-4">
                    Service Report for Orders Delivered (Averages)
                  </caption>
                  <thead className="text-khamco-primary font-bold">
                    <tr className="border-b-2 border-r-2 border-l-2 border-[blue] relative">
                      <td className="text-center p-2 bg-[#ddd]">Month</td>
                      <td className="text-center p-2 bg-[#ddd]">Seconds</td>
                      <td className="text-center p-2 bg-[#ddd]">Minutes</td>
                      <td className="text-center p-2 bg-[#ddd]">Hours</td>
                      <td className="text-center p-2 bg-[#ddd]">Days</td>
                      <td className="text-center p-2 bg-[#ddd]">Weeks</td>
                      <td className="text-center p-2 bg-[#ddd]">Months</td>
                      <td className="text-center p-2 bg-[#ddd]">Years</td>
                    </tr>
                  </thead>
                  <tbody>
                    {averageDurations &&
                      averageDurations.map((duration, index) => (
                        <tr
                          className="border-b-2 border-r-2 border-l-2 border-[blue] relative"
                          key={index}
                        >
                          <td className="text-center p-2">
                            {new Date(
                              `${duration._id}/01/${new Date().getFullYear()}`
                            ).toLocaleDateString("en-US", {
                              month: "long",
                              year: "numeric",
                            })}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_seconds.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_minutes.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_hours.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_days.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_weeks.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_months.toFixed(2)}
                          </td>
                          <td className="text-center p-2">
                            {duration.delivered_years.toFixed(2)}
                          </td>
                        </tr>
                      ))}
                  </tbody>
                </table>
              )}
            </>
          )}
        </section>
      </main>
      <Footer />
    </>
  );
};

export default AdminServiceTimes;
